import React from 'react';
import { View, Image } from 'react-native';
import StyleCentre from './StyleCenter';

const Center =()=>{
    return <View>
        <Image style = {StyleCentre.imgStyle} source ={{uri:"https://ru-ru.learn.canva.com/wp-content/uploads/sites/19/2020/07/paul-skorupskas-7KLa-xLbSXA-unsplash-2.jpg"} }></Image>
    </View>
}

export default Center;
